import * as React from 'react';
import { NavLink, Outlet } from "react-router";

export default function Navigation() {
  return (
    <>
      <nav>
        <ul>
          <li>
            <NavLink to="/">Home</NavLink>
          </li>
        </ul>
      </nav>
      <Outlet />
    </>
  );
}
